import { Link } from 'react-router-dom';

export default function NavBar() {
  return (
    <header className="header">
      <div className="logo">Movie Booker</div>
      <nav className="nav">
        <Link to="/">Login</Link>
        <Link to="/booking">Booking</Link>
        <Link to="/payment">Payment</Link>
      </nav>
    </header>
  );
}
